import React from "react";
import styled from "styled-components";

const VideoContainer = styled.div`
  width: 100vw;
  height: 100vh;
  background-color: var(--color-black);
`;

const VideoPlayer = () => {
  return <VideoContainer></VideoContainer>;
};

export default VideoPlayer;
